	const [ addWork, setAddWork ]= useState({ id:null , name:"", description:"", status:"" })
  setAddWork(item)

	return( 
      <div className={"modification-element"} >  
        <label className="view-table-name"> { item.name } </label> 
        <label  className="view-table-status"> { item.status } </label>
        <button className="button-work modification"   > OK </button>  
      </div> 
  )
}

